function buscaPalabras(){$("#MainContent_txtBuscar").autocomplete({source:function(n,t){$.ajax({url:"../BuscaPalabra.asmx/ObtenerListaAutocomplete",data:"{ 'prefixText': '"+n.term+"' }",dataType:"json",type:"POST",contentType:"application/json; charset=utf-8",dataFilter:function(n){return n},success:function(n){t($.map(n.d,function(n){return{value:n.split("-")[0],valcon:n.split("-")[1]}}))},error:function(n,t){alert(t)}})},select:function(n,t){$("#MainContent_hdComerId").val(t.item.valcon);itemSel(t.item.valcon)},minLength:2})}function itemSel(n){document.getElementById("MainContent_hdComerId").value=n;__doPostBack("MainContent_hdComerId","")}function validarClic(){$("[id$=btnBuscar]").on("click",function(){$("input[id$='txtBuscar']").val("");$("input[id$='txtBuscar']").blur()})}jQuery(function(){buscaPalabras();validarClic();Sys.WebForms.PageRequestManager.getInstance().add_endRequest(buscaPalabras);Sys.WebForms.PageRequestManager.getInstance().add_endRequest(validarClic)});